import React from "react";
import { Typography, Divider, Link, Menu, Grid, Toolbar, Container, Tabs, Tab, Box, IconButton, Button } from '@material-ui/core'

import useStyles from "../styles";

const Filter = () => {

    return (
        <Container maxWidth="md">
            <Grid container spacing={2} direction="row">
                <Grid item xs={12}></Grid>
                <Grid item xs={12}></Grid>
                <Grid item xs={12}>
                    <Container maxWidth="md">
                        <Typography variant="h2" align="center" color="textPrimary" gutterBottom>
                        ProMiSE filter information data
                        </Typography>
                    </Container>
                </Grid>
                <Grid item xs={12}>
                    <Divider p={5}/>
                </Grid>
            </Grid>
        </Container>
    );
}
export default Filter;
